import React from 'react';

const NotificationDetails = (notification) => {
    return ( 
        <div>
        <p>{notification.content}</p>
        <p>{notification.date}</p>
        <p>{notification.state_date}</p>
        <p>{notification.state}</p>
    </div>
     );
}

export default NotificationDetails;
